import React, {ReactNode} from 'react';
import styled from 'styled-components';

type props = {
    children?:ReactNode;
}
const BaseTemplate = ({children}:props) =>{
    return(
        <Wrap>
            <Header>
            header
            </Header>
            <div>
                {children}
            </div>
        </Wrap>
    );
}

const Wrap = styled.div`
    width:100%;
`;

export default BaseTemplate;
